import React from "react";
import {Title} from './Title';
function Service() {
    return(
        <>
        <Title/>
        <div className="col-sm-8 row mx-auto text-center"> 
            <img src="./images/service_auto.png"></img>
        </div>
        </>
    );
}
export {Service};
